/* eslint-disable no-useless-escape */
export const testLog = () => console.log('hello world');

export const exoticcaLog = () => {
    const styleOptions = 'fonst-size: 18px; color: #6b17e8';
    console.log('%c                                                                                ', styleOptions)
    console.log('%c ******** **     **   *******   ********** **   ******    ******      **        ', styleOptions)
    console.log('%c /**///// //**   **   **/////** /////**/// /**  **////**  **////**    ****      ', styleOptions)
    console.log('%c /**       //** **   **     //**    /**    /** **    //  **    //    **//**     ', styleOptions)
    console.log('%c /*******   //***   /**      /**    /**    /**/**       /**         **  //**    ', styleOptions)
    console.log('%c /**////     **/**  /**      /**    /**    /**/**       /**        **********   ', styleOptions)
    console.log('%c /**        ** //** //**     **     /**    /**//**    **//**    **/**//////**   ', styleOptions)
    console.log('%c /******** **   //** //*******      /**    /** //******  //****** /**     /**   ', styleOptions)
    console.log('%c //////// //     //   ///////       //     //   //////    //////  //      //    ', styleOptions)
    console.log('%c                                                                                ', styleOptions)

}
